INSERT INTO `event_navi_comment` VALUES (/*comment_id*/10045005, /*where_type*/57, /*character_id*/190801, /*face_type*/1, /*character_name*/"カリン", /*description*/"イベントお疲れ様です！\n皆さんのご活躍ぶりには\nいつも感謝しています", /*voice_id*/5, /*start_time*/"2020/07/16 12:00:00", /*end_time*/"2020/07/25 14:59:59", /*pos_x*/-416.5, /*pos_y*/0.0, /*change_face_time*/0.0, /*change_face_type*/1, /*event_id*/10045);
INSERT INTO `event_navi_comment` VALUES (/*comment_id*/10045006, /*where_type*/55, /*character_id*/190801, /*face_type*/1, /*character_name*/"カリン", /*description*/"ギルド管理協会です！\n討伐証をお持ちでしたら、\n報酬交換できますよ", /*voice_id*/1, /*start_time*/"2020/07/16 12:00:00", /*end_time*/"2020/07/25 14:59:59", /*pos_x*/-363.0, /*pos_y*/0.0, /*change_face_time*/5.506, /*change_face_type*/2, /*event_id*/10045);
