INSERT INTO `event_navi_comment` VALUES (/*comment_id*/10056002, /*where_type*/53, /*character_id*/190804, /*face_type*/1, /*character_name*/"カリン", /*description*/"ミッションをクリアして、\n報酬をゲットしましょう！", /*voice_id*/2, /*start_time*/"2020/12/31 12:00:00", /*end_time*/"2021/01/18 14:59:59", /*pos_x*/-416.5, /*pos_y*/0.0, /*change_face_time*/3.099, /*change_face_type*/2, /*event_id*/10056);
INSERT INTO `event_navi_comment` VALUES (/*comment_id*/10056003, /*where_type*/54, /*character_id*/190804, /*face_type*/1, /*character_name*/"カリン", /*description*/"受け取ることができる\n報酬があるようです\n確認してみてください", /*voice_id*/3, /*start_time*/"2020/12/31 12:00:00", /*end_time*/"2021/01/18 14:59:59", /*pos_x*/-416.5, /*pos_y*/0.0, /*change_face_time*/2.801, /*change_face_type*/2, /*event_id*/10056);
INSERT INTO `event_navi_comment` VALUES (/*comment_id*/10056004, /*where_type*/54, /*character_id*/190804, /*face_type*/2, /*character_name*/"カリン", /*description*/"報酬がもらえますよ！\nチェックしてみてください", /*voice_id*/4, /*start_time*/"2020/12/31 12:00:00", /*end_time*/"2021/01/18 14:59:59", /*pos_x*/-416.5, /*pos_y*/0.0, /*change_face_time*/0.0, /*change_face_type*/2, /*event_id*/10056);
INSERT INTO `event_navi_comment` VALUES (/*comment_id*/10056005, /*where_type*/57, /*character_id*/190804, /*face_type*/1, /*character_name*/"カリン", /*description*/"イベントお疲れ様です！\n皆さんのご活躍ぶりには\nいつも感謝しています", /*voice_id*/5, /*start_time*/"2020/12/31 12:00:00", /*end_time*/"2021/01/18 14:59:59", /*pos_x*/-416.5, /*pos_y*/0.0, /*change_face_time*/0.0, /*change_face_type*/1, /*event_id*/10056);
INSERT INTO `event_navi_comment` VALUES (/*comment_id*/10056006, /*where_type*/55, /*character_id*/190804, /*face_type*/1, /*character_name*/"カリン", /*description*/"ギルド管理協会です！\n討伐証をお持ちでしたら、\n報酬交換できますよ", /*voice_id*/1, /*start_time*/"2020/12/31 12:00:00", /*end_time*/"2021/01/18 14:59:59", /*pos_x*/-363.0, /*pos_y*/0.0, /*change_face_time*/5.506, /*change_face_type*/2, /*event_id*/10056);
INSERT INTO `event_navi_comment` VALUES (/*comment_id*/10056007, /*where_type*/55, /*character_id*/190804, /*face_type*/2, /*character_name*/"カリン", /*description*/"お疲れ様です！\nここでは、討伐証と報酬を\n交換することができます！", /*voice_id*/2, /*start_time*/"2020/12/31 12:00:00", /*end_time*/"2021/01/18 14:59:59", /*pos_x*/-363.0, /*pos_y*/0.0, /*change_face_time*/1.216, /*change_face_type*/1, /*event_id*/10056);
INSERT INTO `event_navi_comment` VALUES (/*comment_id*/10056008, /*where_type*/56, /*character_id*/190804, /*face_type*/2, /*character_name*/"カリン", /*description*/"お疲れ様でした\n討伐証の交換、\nお忘れないように！", /*voice_id*/3, /*start_time*/"2020/12/31 12:00:00", /*end_time*/"2021/01/18 14:59:59", /*pos_x*/-363.0, /*pos_y*/0.0, /*change_face_time*/1.539, /*change_face_type*/1, /*event_id*/10056);
