INSERT INTO `event_navi_comment` VALUES (/*comment_id*/10083001, /*where_type*/53, /*character_id*/190804, /*face_type*/1, /*character_name*/"カリン", /*description*/"ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", /*voice_id*/1, /*start_time*/"2022/01/18 12:00:00", /*end_time*/"2022/01/27 14:59:59", /*pos_x*/-416.5, /*pos_y*/0.0, /*change_face_time*/3.414, /*change_face_type*/2, /*event_id*/10083);
